					<h1>Сверление сквозного отверстия</h1>
									<p>Объект: Московская область, частный дом.</p>

<p>Задача: пробурить отверстие ф162 глубиной 800мм в кирпиче, в жилом загородном доме, с минимальным количеством грязи и пыли.</p>

